func TestOptionStart(t *testing.T) {
	env.SetProjectEnvName("bybit-test-1")
	s := GetOptionService()
	s.Start(nil)
	time.Sleep(time.Second * 5)
	qpList := s.GetQuotePriceList()
	if len(qpList) == 0 {
		t.Errorf("invalid quote price list")
	} else {
		res, _ := json.MarshalIndent(qpList, "", "\t")
		t.Log("GetQuotePriceList", len(qpList), string(res))
	}

	price := s.GetQuotePrice("BTC-25MAY23-1900-C")
	t.Log(price)
}

func TestExpired(t *testing.T) {
	s := "BTC-30JUN23-8000-C"
	qp := OptionQuotePrice{}
	qp.DeliveryTime, _ = parseSymbolDeliveryTime(s)

	// 2023-06-30 08:00:00 +0000 UTC
	t.Log(qp.DeliveryTime)
	// 2023-06-30 08:11:00 +0000 UTC
	t1 := time.Date(2023, time.June, 30, 8, 11, 0, 0, time.UTC)
	t.Log(t1)
	if !qp.isExpired(t1) {
		t.Log("should be expired")
	}

	// 2023-06-30 08:00:00 +0000 UTC
	t2 := time.Date(2023, time.June, 30, 8, 0, 0, 0, time.UTC)
	t.Log(t2)
	if qp.isExpired(t2) {
		t.Log("should not be expired")
	}
}

